import axios from 'axios';

const appLogin = (username, password) => {
     const response = axios({
        method: 'post',
        url: 'http://localhost:5000/projects',
        data: {
          username: username,
          password: password
        }
      })
      .then(response => {
          console.log(response);
      })
      console.log(response);
}

export default appLogin
